<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <script src="https://kit.fontawesome.com/1cf830eab3.js" crossorigin="anonymous"></script>
    <title>Project</title>
    <link rel="icon"
          sizes="any"
          type="image/svg+xml"
          href="lib/assets/logo.svg" />
    <style>
        @font-face {
            font-family: Roboto;
            src: "lib/assets/fonts/Roboto-Thin.ttf";
            font-weight: 200;
        }

        @font-face {
            font-family: Roboto;
            src: "lib/assets/fonts/Roboto-Regular.ttf";
            font-weight: 400;
        }

        @font-face {
            font-family: Roboto;
            src: "lib/assets/fonts/Roboto-Medium.ttf";
            font-weight: 600;
        }

        @font-face {
            font-family: Roboto;
            src: "lib/assets/fonts/Roboto-Bold.ttf";
            font-weight: 800;
        }

        html {
            height: 100%;
            margin: 0;
            padding: 0;
            width: 100%;
            font-family: Roboto;
            overflow: hidden;
        }

        ::-webkit-scrollbar {
            width: 0px;
            background: transparent; /* make scrollbar transparent */
        }

        body {
            height: 100%;
            margin: 0;
            padding: 0;
            width: 100%;
            font-family: Roboto;
            overflow: hidden;
            position: relative;
        }

        #header {
            width: 100%;
            height: 48px;
            background-color: #262626;
            display: inline-flex;
            justify-content: space-between;
            align-items: center;
            position: absolute;
            top: 0;
            left: 0;
            z-index: 2;
        }

        #body {
            width: 100%;
            height: 100%;
            flex: 1;
            position: absolute;
            top: 0px;
            left: 0;
            z-index: 2;
            overflow: hidden;
        }

        #left_view {
            top: 86px;
            left: 0;
            height: 100%;
            width: 260px;
            background-color: white;
            position: absolute;
        }

        #right_view {
            top: 48px;
            right: 0;
            height: 100%;
            width: 260px;
            background-color: white;
            position: absolute;
        }
        /**/
        #canvas_view {
            width: 100%;
            height: 100%;
            background-color: #f5f5f5;
        }
        /**/
        #tab_bar_left {
            position: relative;
            display: flex;
            width: 100%;
            padding: 8px 12px;
        }

        #tab_bar_right {
            position: relative;
            display: flex;
            width: 100%;
            padding: 8px 12px;
        }

        .tab_left {
            padding: 4px;
            margin-right: 8px;
            background-color: transparent;
            border: none;
            font-size: 12px;
            line-height: 16px;
            font-weight: 700;
            color: #262626;
        }

        .tab_right {
            padding: 4px;
            margin-right: 8px;
            background-color: transparent;
            border: none;
            font-size: 12px;
            line-height: 16px;
            font-weight: 700;
            color: #262626;
        }

        .tab_left:hover {
            opacity: 0.7;
        }

        #resize_left_view_line {
            padding: 0 4px;
            position: absolute;
            right: 0;
            top: 0;
            height: 100%;
            width: 2px;
            background-color: white;
            opacity: 0.1;
            border: none;
            cursor: col-resize;
        }

        .space_line {
            position: absolute;
            bottom: 0;
            left: 0;
            width: 100%;
            height: 1px;
            background-color: #e5e5e5;
        }

        #unevent_element {
            pointer-events: none;
        }
    </style>
</head>
